import { PopularIngredients } from "../pages/Home";

interface RenderIngredients {
    ingredients: PopularIngredients[] | undefined
}

const Ingredients = ({ingredients}: RenderIngredients) => {
    return ( 
        <div className="ingredientsContainer">
            <div className="titleContainer">
               <span className="title">Popular Ingredients</span>
            </div>
            
            {
                ingredients?.map(ingredient =>
                    <div className="imagesContainer">
                        <div className="nameContainer">
                            <span className="ingredientName"> {ingredient.name} </span>
                        </div>
                        <img src={ingredient.image} alt="ingredient image" />
                    </div>
                )
            }

        </div>
     );
}
 
export default Ingredients;
